import React, {useEffect, useState} from 'react'

export default function Room() {
    
  const [rooms, setRooms] = useState('')

  async function getFromServer() {
    const response = await fetch('/api/room/')
    const data = await response.json()
    setRooms(data)
  }

  useEffect(() => {
    getFromServer()
  }, [])

  return (
    <div>Room</div>
  )
}
